import './App.css';
import store from "./store";
import Score from './components/Score';
import Board from './components/Board';

import { Provider } from 'react-redux';

const App = () => {
  return (
    <Provider store={store}>
      <Score />
      <Board />
    </Provider>
  )
}
export default App;
